tables.table_schema:
CREATE TABLE NFTs (
    id INT PRIMARY KEY,
    token_id INT,
    token_uri VARCHAR
);

CREATE TABLE nft_token (
  id INT PRIMARY KEY,
  token_id BIGINT UNIQUE,
  owner_address VARCHAR(255),
  metadata JSON
);

CREATE TABLE nft_minter (
  minter_id INT PRIMARY KEY,
  minter_name VARCHAR(255),
  wallet_address VARCHAR(255),
  procedures JSON
);

CREATE TABLE NFTs (
    id INT PRIMARY KEY,
    name VARCHAR(255),
    artist VARCHAR(255),
    created_at TIMESTAMP
);

CREATE TABLE MintingLogs (
    log_id INT PRIMARY KEY,
    nft_id INT,
    mint_date DATE,
    minted_by VARCHAR(255)
);

CREATE TABLE nft_collections (
    collection_id SERIAL PRIMARY KEY,
    collection_name VARCHAR(255) NOT NULL
);

CREATE TABLE nfts (
    nft_id SERIAL PRIMARY KEY,
    nft_name VARCHAR(255) NOT NULL,
    collection_id INT NOT NULL,
    FOREIGN KEY (collection_id) REFERENCES nft_collections(collection_id)
);

CREATE TABLE minting_logs (
    log_id SERIAL PRIMARY KEY,
    nft_id INT NOT NULL,
    minting_address VARCHAR(255) NOT NULL,
    minted_date DATE NOT NULL
);

CREATE TABLE Owners (
    owner_id INT PRIMARY KEY,
    owner_name VARCHAR(255),
    wallet_address VARCHAR(255),
    creation_date DATE
);

CREATE TABLE Procedures (
    procedure_id INT PRIMARY KEY,
    procedure_name VARCHAR(255),
    script TEXT,
    creation_date DATE
);
